import React from "react";
import Img from '../assets/image 1.png';
function Navbar(){
    return(
       <div>
        <div className="front">
            <span><i class="fa-solid fa-chevron-left"></i></span>
            <img src={Img} alt="" />
        </div>
       </div>
    )
}

export default Navbar;
